// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;
contract Transactions{
    struct Transaction{
        uint TransactionID;
        uint PatchNo;
        uint CurrentOwner;
        uint FromOwner;
        uint TransferedAmount;
        uint TransactionDate;
    }

    mapping (uint => Transaction) public transactions;
//   event savingsEvent(uint indexed _memberId);
    uint public transactionsCount;
    constructor()  {
        transactionsCount = 0;
    }

    function addPatch(uint _patchno, uint _currentowner, uint _fromowner, uint _transamount, uint _transdate) public {
    transactions[transactionsCount] = Transaction(transactionsCount,_patchno, _currentowner, _fromowner, _transamount, _transdate);
    transactionsCount++;
  }
}

